import { useNavigate, useParams } from "react-router-dom"
import { getByIdB } from "../axios/buyAxios"
import { useDispatch, useSelector } from "react-redux"
import { getBI } from "../redux/actions/buyAction"
import { useEffect } from "react"

export const PersonalArea = () => {
    const dp = useDispatch()
    alert("נכנסת לאיזור האישי")
    const n = useNavigate()
    const id = useSelector(y => y.datareducerL.currentUser._id)
    useEffect(() => {
        getByIdB(id)
            .then((x) => {
                dp(getBI(x.data))
            })
            .catch((err) => console.log(err))


    }, [])

    const pr = useSelector(o => o.datareducerB.buys)
    console.log("jjjjjhhhhh" + pr);

    return <>
        <div className="container" style={{ display: "flex", flexWrap: "wrap" }}>


            {pr.map((x, i) => (

                <div key={i} className="card" style={{ width: "300px", margin: "2rem", borderColor: "brown", borderStyle: "solid", backgroundColor: "white" }}>
                    <div className="card-body" style={{ width: "400px",}} >

                        <td>תאריך קניה{x.Date}</td>
                        <td>קוד לקוח{x.CusCode}</td>
                        <button>עדכן</button>
                        <button>הסר</button>

                        <button onClick={() => { n(`../moreB/${x._id}`); debugger }}>פרטי קניה</button>
                    </div>
                </div>
            ))}
        </div>


    </>





}
